import Item from "./Item";

const SideMenu = ({ itemData }) => {
  return (
    <div className="side-menu">
      <div className="closeBtn ">
        <FontAwesomeIcon icon={fas.faTimesCircle} />
        <i className="fas fa-times-circle close"></i>
      </div>
      {itemData.map((item) => (
        <Item />
      ))}
    </div>
  );
};

export default SideMenu;

